import React, { useState } from "react";

import Header from "../../Header";
import { Offer1 } from "../../Offer";
const id_bg = require("../../../assets/id_bg.jpg").default;

const Interior = () => {
  const [param, setParam] = useState("");

  const newTo = [
    {
      pathname: "/interior-design/gallery",
      param1: "Modern",
    },
    {
      pathname: "/interior-design/gallery",
      param1: "Contemporary",
    },
    {
      pathname: "/interior-design/gallery",
      param1: "Minimalsitic",
    },
    {
      pathname: "/interior-design/gallery",
      param1: "Vintage",
    },
    {
      pathname: "/interior-design/gallery",
      param1: "European",
    },
  ];

  return (
    <div
      className="row justify-content-center w-100"
      style={{ margin: 0, padding: 0, width: "100%" }}
    >
      <Header
        title="Creating excellent spaces"
        text="100% Hassle - Free and managed by us!"
        bg={id_bg}
      />
      <h4
        style={{
          textAlign: "center",
          width: 200,
          padding: 10,
          marginTop: 20,
        }}
        className="border-bottom"
      >
        Themes
      </h4>
      <div className="row justify-content-center">
        <Offer1
          height={200}
          width={450}
          icon="http://cdn.home-designing.com/wp-content/uploads/2018/01/grey-quilted-couches-large-photograph-grey-shade-living-room.jpg"
          title="Modern"
          link={newTo[0]}
        />
        <Offer1
          height={200}
          width={450}
          icon="https://media.architecturaldigest.com/photos/5744d37dff9db5a43d5cf9c6/master/w_1920%2Cc_limit/contemporary-interior-design-004.jpg"
          title="Contemporary"
          link={newTo[1]}
        />

        <Offer1
          height={200}
          width={450}
          icon="https://www.smalldesignideas.com/wp-content/uploads/2015/04/5.jpg"
          title="Minimalsitic"
          link={newTo[2]}
        />
        <Offer1
          height={200}
          width={450}
          icon="https://www.smalldesignideas.com/wp-content/uploads/2015/04/5.jpg"
          title="Vintage"
          link={newTo[3]}
        />
        <Offer1
          height={200}
          width={450}
          icon="https://www.smalldesignideas.com/wp-content/uploads/2015/04/5.jpg"
          title="European"
          link={newTo[4]}
        />
      </div>
    </div>
  );
};

export default Interior;
